import React, { useState, useEffect, useCallback, Suspense } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { useAuth } from '../App';
import './css/HealthReport.css'; // Ensure you create this CSS file

// Lazy load heavy components for better performance
const LazyChart = React.lazy(() => import('./LazyChart'));

// --- Helper Functions ---
const getAQIColor = (aqi) => {
    if (aqi === null || aqi === undefined) return '#6b7280';
    if (aqi <= 50) return '#10b981';
    if (aqi <= 100) return '#f59e0b';
    if (aqi <= 200) return '#ef4444';
    return '#7c2d12';
};

function HealthReport() {
    const { user, logout } = useAuth();
    const [username] = useState(user?.name || null);
    const [reportData, setReportData] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    const navigate = useNavigate();
    const API_BASE_URL = process.env.REACT_APP_API_URL || 'http://localhost:8000';

    const fetchReportData = useCallback(async () => {
        if (!username) {
            navigate('/login');
            return;
        }
        setLoading(true);
        try {
            const url = new URL(`${API_BASE_URL}/api/health-report/`);
            url.searchParams.append('username', username);
            
            // Get location to provide to the backend
            if (navigator.geolocation) {
                const position = await new Promise((resolve, reject) => {
                    navigator.geolocation.getCurrentPosition(resolve, reject, { timeout: 5000 });
                });
                url.searchParams.append('lat', position.coords.latitude);
                url.searchParams.append('lng', position.coords.longitude);
            }

            const response = await fetch(url);
            if (!response.ok) {
                const errData = await response.json();
                if (errData.redirect_to) navigate(errData.redirect_to);
                throw new Error(errData.error || 'Failed to fetch report data');
            }
            const data = await response.json();
            setReportData(data);
        } catch (err) {
            setError(err.message);
        } finally {
            setLoading(false);
        }
    }, [username, navigate, API_BASE_URL]);

    useEffect(() => {
        fetchReportData();
    }, [fetchReportData]);

    if (loading) return <div className="panel-loader"><h2>Generating Your Health Report...</h2></div>;
    if (error) return <div className="error-message"><h2>Error</h2><p>{error}</p></div>;
    if (!reportData) return <div>No report data available.</div>;

    const { health_assessment, nearest_station, forecast } = reportData;

    return (
        <div className="report-page">
            <nav className="navbar">{/* --- Your Navbar JSX Here --- */}</nav>
            <div className="report-container">
                <div className="header-section">
                    <h1>Your Personalized Health Report</h1>
                    <p>Analysis based on your health profile and real-time air quality at your nearest sensor station.</p>
                </div>

                <div className="overview-grid">
                    <div className="overview-card">
                        <h4>Health Score</h4>
                        <div className="health-score">{health_assessment.score}</div>
                        <div className={`risk-level ${health_assessment.risk_level.toLowerCase()}`}>{health_assessment.risk_level} Risk</div>
                    </div>
                    <div className="overview-card">
                        <h4>Nearest Station</h4>
                        <div className="station-name">{nearest_station.data.station_info.name}</div>
                        <div className="station-aqi" style={{ color: getAQIColor(nearest_station.data.highest_sub_index) }}>
                            AQI: {nearest_station.data.highest_sub_index}
                        </div>
                    </div>
                </div>

                <div className="recommendations-section">
                    <h3 className="section-title"><i className="fas fa-lightbulb"></i> Your Priority Recommendations</h3>
                    <div className="recommendations-grid">
                        {health_assessment.priority_actions.map((action, index) => (
                            <div key={index} className="recommendation-card">
                                <div className="rec-icon"><i className="fas fa-check-circle"></i></div>
                                <div className="rec-text">{action}</div>
                            </div>
                        ))}
                    </div>
                </div>
                
                <div className="dashboard-grid">
                    <div className="dashboard-card">
                        <h3>Forecast (Nearest Station)</h3>
                         <Suspense fallback={<div className="panel-loader">Loading Chart...</div>}>
                            <LazyChart forecastData={forecast.data} selectedParameter={'pm25'} />
                        </Suspense>
                    </div>
                    <div className="dashboard-card">
                        <h3>Full Health Details</h3>
                        <ul>
                            {Object.entries(health_assessment.details).map(([key, value]) => (
                                <li key={key}><strong>{key}:</strong> {Array.isArray(value) ? value.join(', ') : value}</li>
                            ))}
                        </ul>
                    </div>
                </div>
            </div>
            <footer className="footer">{/* --- Your Footer JSX Here --- */}</footer>
        </div>
    );
}

export default HealthReport;
